import Nav from "../Nav";
import Helmet from "react-helmet";
import React from "react";
import Card from "./Card";
import "./portfolio.Module.css";
import webpageImg from "./../images/portfolio/websiteImg.png";
import textleMappingImg from "./../images/portfolio/textileMappingImg.png";
//import Canvas from "./Canvas";

export default function Portfolio() {
  return (
    <div>
      <Nav />
      <div className="cardHolder">
        <Card
          name="This Website"
          image={webpageImg}
          descHead="Personal Resume Website"
          skils="          React website development
          <br></br>
          Server management (DigitalOcean)
          <br></br>
          Html, Css, Js
          <br></br>
          Networking"
        />
        <Card name="Textile Mapping" image={textleMappingImg} />
      </div>
    </div>
  );
}
